func contains(charSlice []rune, ch string) bool {
	for _, digit := range charSlice {
		if string(digit) == ch {
			return true
		} 
	}
	return false
}

func lengthOfLongestSubstring(s string) (int, []string) {
	longestSubStr := []string{}
	currentSubStr := []string{}

	for i, _ := range s {
		compSlice := s[i:]

		if(len(longestSubStr) > (len(s) - i + 1)){
			break
		}

		for _, ru := range compSlice {
			ch := string(ru)

			if slices.Contains(currentSubStr, ch) {
				if len(currentSubStr) > len(longestSubStr) {
					longestSubStr = currentSubStr
				}
				currentSubStr = nil
			} else {
				currentSubStr = append(currentSubStr, ch)
			}
			if len(longestSubStr) < 1 {
				longestSubStr = currentSubStr
			}
		}
		if len(currentSubStr) > len(longestSubStr) {
			longestSubStr = currentSubStr
		}
		currentSubStr = nil
	}

	return len(longestSubStr), longestSubStr
}